import "./App.scss";
import "./reset.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1></h1>
        <ul>
          <li>Home</li>
          <li>Contact</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
